import React from "react";

const Step4ReviewSubmit = ({ prevStep, formData }) => {
  return (
    <div>
      <h2 className="text-xl font-semibold mb-4">Review & Submit</h2>
      <p><strong>Name:</strong> {formData.name}</p>
      <p><strong>Email:</strong> {formData.email}</p>
      <p><strong>Pharmacy Name:</strong> {formData.pharmacyName}</p>

      <button onClick={prevStep} className="mt-4 px-4 py-2 bg-gray-400 text-white rounded-md mr-2">Back</button>
      <button className="mt-4 px-4 py-2 bg-green-600 text-white rounded-md">Submit</button>
    </div>
  );
};

export default Step4ReviewSubmit;
